import Header from "./Header";

function Admin() {
  return (
    <div className="app">
      <Header />
      <h2>Welcome to Admin Page!</h2>
      <p>
        <ul>
          <li>Quiz 1</li>
          <li>Quiz 2</li>
          <li>Quiz 3</li>
          <li>Quiz 4</li>
        </ul>
      </p>
    </div>
  );
}

export default Admin;
